import React from 'react';
import Head from 'next/head';

type Props = {
  title: string;
};

const MetaSeo: React.FunctionComponent<Props> = ({ title }) => {
  return (
    <Head>
      {/* Primary Meta Tags */}
      <title>{title}</title>
      <meta name="title" content={title} />
    </Head>
  );
};

export default MetaSeo;
